    // </Card>
    <Accordion.Item eventKey="0">
        <Accordion.Header>{props.title}</Accordion.Header>
        <Accordion.Body>
            {props.description}
        </Accordion.Body>
        </Accordion.Item>

  );
};

export default ProjectCard;
